import React from "react";
import miiree12lbImg from "./assets/images/tshirts/miiree12lb.png";
import scienceImg from "./assets/images/tshirts/science.png";
import ItemDisplayer from "./ItemDisplayer.jsx";
import { useNavigate } from "react-router-dom";

export default function Tshirts() {
    const tshirts = [
        { title: "miiree12lb", img: miiree12lbImg },
        { title: "Science Fellows", img: scienceImg },
    ];

    const openSlider = (img) => {
        navigate("/slider", { state: { image: img } });
    };

    return (
        <div>
            <h2>T-Shirts</h2>
            <div className="item-displayer">
            {tshirts.map((tshirt, index) => (
                    <ItemDisplayer
                        key={index}
                        title={tshirt.title}
                        img={tshirt.img}
                        onClick={() => openSlider(tshirt.img)}
                    />
                ))}
            </div>
        </div>
    );
}
